import React from 'react';
import './Intro.css';
export default function Intro(){
    return(
        <>
        <div className="i">
            <div className="i-left">
                <h2 className='i-i'>Hii! My Name is </h2>
                <h1 className='i-name'>Kaif Siddique </h1>
            </div>
            <div className="i-right"></div>
        </div>
        </>
    )
}
